const App = async () => {
  const response = await fetch("https://randomuser.me/api/?results=20");
  const data = await response.json();
  console.log(data);
  console.log(data.results.location.street.name);

  const loadedLocation = [];
  for (const key in data) {
    loadedLocation.push({
      streetName: data[key].location.street.name,
      streetNumber: data[key].results.location.street.number,
    });
  }

  console.log(loadedLocation);
  return (
    <div>
      <h2>Let's get started!</h2>
    </div>
  );
};

export default App;
